let output = [];
let countries = {};

for (item of items) {
  // Skip hxl row.
  if (item.json.ISO3.substr(0, 1) == '#') {
    continue;
  }

  // Skip empty values.
  if (item.json['Conflict Stock Displacement'] == '' && item.json['Conflict Internal Displacements'] == '' && item.json['Disaster Internal Displacements'] == '' && item.json['Disaster Stock Displacement'] == '') {
    continue;
  }

  if (!countries[item.json.ISO3]) {
    countries[item.json.ISO3] = {
      id: item.json.ISO3,
      country: item.json.Name,
      values: []
    }
  }
}

for (const country in countries) {
    output.push(countries[country]);
}

return output;

let output = [];

for (item of items) {
  // Skip hxl row.
  if (item.json.ISO3.substr(0, 1) == '#') {
    continue;
  }

  // Skip empty values.
  if (item.json['Conflict Stock Displacement'] == '' && item.json['Conflict Internal Displacements'] == '' && item.json['Disaster Internal Displacements'] == '' && item.json['Disaster Stock Displacement'] == '') {
    continue;
  }

  output.push({
    id: item.json.ISO3 + '_' + item.json.Year,
    parent_id: item.json.ISO3,
    year: item.json.Year,
    conflict_stock_displacement: item.json['Conflict Stock Displacement'].length == 0 ? null : item.json['Conflict Stock Displacement'],
    conflict_internal_displacements: item.json['Conflict Internal Displacements'].length == 0 ? null : item.json['Conflict Internal Displacements'],
    disaster_internal_displacements: item.json['Disaster Internal Displacements'].length == 0 ? null : item.json['Disaster Internal Displacements'],
    disaster_stock_displacement: item.json['Disaster Stock Displacement'].length == 0 ? null : item.json['Disaster Stock Displacement'],
  });
}

return output;
